import React from 'react';
import { BodyCarte,PageCarte} from './CarteElements';
import  CarteRendering from '../../Pages';

const Carte = (AnneeCarte) => {
    return (
        <>
            <BodyCarte>
                <PageCarte>
                    <CarteRendering Annee={AnneeCarte} />
                </PageCarte>
            </BodyCarte>
        </>
    );
}

export default Carte;
